import { POST_PARTY_SUB_PARTY, POST_PARTY_SUB_PARTY_SUCCESS } from "./actionType";

  export const PostMethodForPartySubParty = (data) => ({
    type: POST_PARTY_SUB_PARTY,
    data,
  });
  
  export const PostMethod_ForPartySubPartyAPISuccess = (data) => ({
    type: POST_PARTY_SUB_PARTY_SUCCESS,
    payload: data,
  });

 
  
/// get Product Category Type list 
export const getPartySubPartylist = () => ({
  type: GET_CATEGORY_TYPE_LIST,
});

export const getPartySubPartySuccess = (list) => ({
  type: GET_CATEGORY_TYPE_LIST_SUCCESS,
  payload: list,
});

////delete api
export const deletePartySubParty= (id) => ({
  type: DELETE_CATEGORY_TYPE_ID,
  id,

});
export const deletePartySubPartySuccess = (msg) => ({
  type: DELETE_CATEGORY_TYPE_ID_SUCCESS,
  payload: msg
}); 

// edit api

export const editPartySubParty = (id,pageMode) => ({
  type: EDIT_CATEGORY_TYPE_ID,
  id,pageMode
})

export const editPartySubPartySuccess = (editData) => ({
  type: EDIT_CATEGORY_TYPE_ID_SUCCESS,
  payload: editData,
})
// update api
export const updatePartySubParty = (updateData, ID) => ({
  type: UPDATE_CATEGORY_TYPE_ID,
  updateData, ID,
})
export const updatePartySubPartySuccess = (msg) => ({
  type: UPDATE_CATEGORY_TYPE_ID_SUCCESS,
  payload: msg,
})
